import React from "react";
import './Button.scss';

const GetAppButton: React.FC<{content: string, conten: string, img: string}>= (props) => {
    return (
        <div>
            <button className="get-app-btn"><img src={props.img} alt="img" className="app-icon"></img> <p><span>{props.content}</span></p><span>{props.conten}</span></button>
        </div>
    );
}
export default GetAppButton;
